import axios from 'axios';

export const getAllCharacters = async () => {
  const response = await axios.get('https://rickandmortyapi.com/api/character');
  const { data } = response;
  return data;
};

export const fetchPrevious = async (url) => {
  const prev = await axios.get(url);
  const { prevData } = prevData;
  return prevData;
};

export const fetchNext = async (url) => {
  const Next = await axios.get(url);
  const { NextData } = NextData;
  return NextData;
}
